INSERT INTO `tipocontaminante` VALUES ('CO','El monóxido de carbono también denominado óxido de carbono (II), gas carbonoso y anhídrido carbonoso (los dos últimos cada vez más en desuso) cuya fórmula química es CO, es un gas inodoro, incoloro y altamente tóxico. Puede causar la muerte cuando se respira en niveles elevados. Se produce por la combustión deficiente de sustancias como gas, gasolina, keroseno, carbón, petróleo, tabaco o madera.','mg/m3'),('NO2','El dióxido de nitrógeno u óxido de nitrógeno (IV) (NO2), es un compuesto químico formado por los elementos nitrógeno y oxígeno, uno de los principales contaminantes entre los varios óxidos de nitrógeno.El dióxido de nitrógeno es de color marrón-amarillento. Se forma como subproducto en los procesos de combustión a altas temperaturas, como en los vehículos motorizados y las plantas eléctricas. Por ello es un contaminante frecuente en zonas urbanas.','ug/m3'),('O3','El ozono (O3) es una sustancia cuya molécula está compuesta por tres átomos de oxígeno, formada al disociarse los 2 átomos que componen el gas de oxígeno. Cada átomo de oxígeno liberado se une a otra molécula de Oxígeno (O2), formando moléculas de Ozono (O3).A temperatura y presión ambientales el ozono es un gas de olor acre y generalmente incoloro, pero en grandes concentraciones puede volverse ligeramente azulado. Si se respira en grandes cantidades, puede provocar una irritación en los ojos y/o garganta, la cual suele pasar después de respirar aire fresco por algunos minutos.','ug/m3'),('PM10','Se denomina PM10 (del ingles Particulate Matter) a pequeñas partículas sólidas o líquidas de polvo, cenizas, hollín, partículas metálicas, cemento o polen, dispersas en la atmósfera, y cuyo diámetro es menor que 10 µm (1 micrómetro corresponde la milésima parte de 1 milímetro). Están formadas principalmente por compuestos inorgánicos como silicatos y aluminatos, metales pesados entre otros, y material orgánico asociado a partículas de carbono (hollín).La contaminación atmosférica por material particulado es la alteración de la composición natural de la atmósfera como consecuencia de la entrada en suspensión de partículas, ya sea por causas naturales o por la acción del hombre (causas antropogénicas).','ug/m3'),('SH2','El sulfuro de hidrógeno se forma a partir de una reacción biológica en sistemas de desagüe o plantas de tratamiento de aguas residuales. El SH2 se genera a través de una fermentación anaeróbica (sin oxígeno) de materia orgánica presente en aguas residuales.','ug/m3'),('SO2','El dióxido de azufre es un óxido cuya fórmula molecular es SO2. Es un gas incoloro con un característico olor asfixiante. Se trata de una sustancia reductora que, con el tiempo, el contacto con el aire y la humedad, se convierte en trióxido de azufre. La velocidad de esta reacción en condiciones normales es baja.En agua se disuelve formando una disolución ácida. Puede ser concebido como el anhidruro de un hipotético ácido sulfuroso (H2SO3).','ug/m3');
