-- Nombrar el nombre de las estaciones que miden la contaminacion para NO2

SELECT * FROM medicion;

Select distinct nombre
from estacion inner join medicion on estacion.id = medicion.idestacion
where medicion.tipoContaminante = 'NO2';

SELECT nombre
FROM estacion,tipocontaminante
WHERE tipoContaminante="NO2"

-- Mostra el numero de estaciones que miden la contaminacion para NO2

SELECT count(*)
from (
SELECT distinct idestacion, tipocontaminante
from Medicion
where tipoContaminante = 'NO2') as TablaDerivada;


select count(*) 
from estacion, tipocontaminante 
where tipocontaminante = 'NO2'

-- Mostrar para cada tipo de contaminante el numero de estaciones que mide su nivel

SELECT count(*), tipoContaminante
from (
Select distinct medicion.idestacion, medicion.tipoContaminante 
from Medicion) as Tabla_derivada
group by TipoContaminante;


-- Obtener todos los datos de las medidas realizadas el dia 3/05/2021 para NO2, ordenado por fecha de forma ascendente

select *
from medicion inner join estacion on estacion.id = medicion.idEstacion
where medicion.fecha = '2021-05-03' and medicion.tipoContaminante = 'NO2'
order by medicion.hora asc;

-- Mostrar el nombre de las estaciones que tengan mediciones para el contaminante SH2 (sulfuro de hidrogeno)

Select distinct nombre
from estacion inner join medicion on estacion.id = medicion.idestacion
where medicion.tipoContaminante = 'SH2';


-- Calcular la contaminacion media diaria para el gas SH2 en cada dia (mostrar la fecha) y estacion (su nombre)

Select medicion.fecha, estacion.nombre, avg(valor)
from estacion inner join medicion on estacion.id = medicion.idestacion
where medicion.tipoContaminante = 'SH2'
group by medicion.fecha, estacion.nombre;


-- Modificar la consulta anterior para mostrar la contaminacion media diaria de gas SH2 por dia y estacion 
-- solo cuando se haya superado un umbral de 10

Select medicion.fecha, estacion.nombre, avg(valor)
from estacion inner join medicion on estacion.id = medicion.idestacion
where medicion.tipoContaminante = 'SH2'
group by medicion.fecha, estacion.nombre
Having avg(valor)> 10;


-- Mostrar nombre de estacion, valor, tipo contaminante y unidad de las mediciones realizadas el 3/05/2021

select estacion.nombre, medicion.valor, medicion.tipocontaminante, tip.unidad
from estacion inner join medicion on estacion.id = medicion.idestacion
inner join tipocontaminante tip on tip.tipoContaminante = medicion.tipoContaminante
where Medicion.fecha = '2021-05-03';